package com.rongke.model;import com.baomidou.mybatisplus.annotations.TableField;import com.baomidou.mybatisplus.annotations.TableId;import com.baomidou.mybatisplus.annotations.TableName;import com.baomidou.mybatisplus.enums.IdType;import com.fasterxml.jackson.annotation.JsonFormat;import java.io.Serializable;/** * @TongdunAudit * @同盾贷前审核结果(tongdun_audit) * @version : Ver 1.0 */@TableName("tongdun_audit")public class TongdunAudit implements Serializable {	@TableField(exist = false)	private static final long serialVersionUID = 1L;	/**	 * @备注:	 * @字段:id INT(10)	 */	@TableId(type = IdType.AUTO)	@JsonFormat(shape = JsonFormat.Shape.STRING)	private Integer id;	/**	 * @备注:	 * @字段:user_id BIGINT(19)	 */	@JsonFormat(shape = JsonFormat.Shape.STRING)	private Long userId;	/**	 * @备注:	 */	private String content;	/**	 * @备注:	 * @字段:	 */	@JsonFormat(shape = JsonFormat.Shape.STRING)	private Long evaluationId;	/**	 * @备注:风险分数	 * @字段:final_score VARCHAR(255)	 */	private String finalScore;	public TongdunAudit(){	}	public TongdunAudit(		Integer id	){		this.id = id;	}	public void setId(Integer id) {		this.id = id;	}	public Integer getId() {		return this.id;	}	public void setUserId(Long userId) {		this.userId = userId;	}	public Long getUserId() {		return this.userId;	}	public void setFinalScore(String finalScore) {		this.finalScore = finalScore;	}	public String getFinalScore() {		return this.finalScore;	}	public String getContent() {		return content;	}	public void setContent(String content) {		this.content = content;	}	public Long getEvaluationId() {		return evaluationId;	}	public void setEvaluationId(Long evaluationId) {		this.evaluationId = evaluationId;	}}